import React from 'react'
import projects from './projects'

function MyWork () {
    const textStyle = {
        textAlign: 'center'
    }
    const myProjects = projects.map(item => <Project  key={item.id} projects={item} />)
    return (
        <div>
            <h1 style={textStyle}>My Work</h1>
            <div class="projects">
                <myProjects/>
            </div>
        </div>
    ) 
}

export default MyWork
